import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { useAuth } from './AuthContext';  // make sure useAuth correctly provides userId

const NewNomineeForm = () => {
    const [formData, setFormData] = useState({
        first_name: '',
        last_name: '',
        department_name: '',
        job_category: '',
        email: '',
        nominator_qualification: ''
    });

    const { authToken, userId } = useAuth(); // Ensure userId is included in useAuth
    const navigate = useNavigate();

    const handleChange = e => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!userId) {
            console.error("User ID is undefined. Please login.");
            navigate('/login'); // Redirect to login if userId is undefined
            return;
        }

        const fullData = { ...formData, user_id: userId };
        axios.post('http://127.0.0.1:5000/nominee/create', fullData, {
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${authToken}`
            }
        })
        .then(response => {
            console.log('Nominee created:', response.data);
            navigate('/dashboard'); // Redirect on success
        })
        .catch(error => {
            console.error('Error creating nominee:', error.response || error);
        });
    };
  return (
    <div className="container">
      <div className="col-14 p-2">
        <legend className="d-flex justify-content-around">New Nominee Form Information</legend>
      </div>
      <div className="d-flex justify-content-center">
        <form onSubmit={handleSubmit} className="bg-light text-dark">
          {/* Form fields as before, handling state updates on change */}
          <div className="form-group">
            <label>Nominee First Name</label>
            <input type="text" name="first_name" value={formData.first_name} onChange={handleChange} className="form-control" placeholder="Nominee First Name" />
          </div>
          <div className="form-group">
            <label>Nominee Last Name</label>
            <input type="text" name="last_name" value={formData.last_name} onChange={handleChange} className="form-control" placeholder="Nominee Last Name" />
          </div>
          <div className="form-group">
            <label>Department Name</label>
            <input type="text" name="department_name" value={formData.department_name} onChange={handleChange} className="form-control" placeholder="Department Name" />
          </div>
          <div className="form-group">
            <label>Job Category</label>
            <input type="text" name="job_category" value={formData.job_category} onChange={handleChange} className="form-control" placeholder="Job Category" />
          </div>
          <div className="form-group">
            <label>Email</label>
            <input type="email" name="email" value={formData.email} onChange={handleChange} className="form-control" placeholder="Email" />
          </div>
          <div className="form-group">
            <label>Nominator Qualification</label>
            <textarea name="nominator_qualification" value={formData.nominator_qualification} onChange={handleChange} className="form-control" placeholder="Your Project Description" />
          </div>
          <div className="form-group">
            <button type="submit" className="btn btn-success">Submit New Nominee</button>
          </div>
        </form>
      </div>
      <div className="col-md-4">
        <a href="/nominee/dashboard" className="btn btn-warning">Back</a>
      </div>
    </div>
  );
};

export default NewNomineeForm;
